export class Students extends Component {

    constructor(props){
        super(props)
        console.log("i am constructor");
    }
    state = {
        counter: 0,
    }
    
    handleCounter(){
        this.setState({counter: this.state.counter+1});
    }


    static getDerivedStateFromProps(props, state){
        console.log(props, state);
